import React from 'react';
import { Divider, Menu } from 'antd';
import "./index.css"

class Lsider extends React.Component {
    render() {
        return (
            <Menu
                mode="inline"
                defaultSelectedKeys={['1']}
                defaultOpenKeys={['sub1']}
                style={{ height: '100%', borderRight: 0 }}
            >
                <Menu.Item key="index" title="扶뒬못" style={{paddingLeft:'16px'}}>
                    <a href="">
                        <span>扶뒬못</span>
                    </a>
                </Menu.Item>
                <Menu.ItemGroup title="option1" className="lsider-menu-item-group">
                <Divider key="divider-1" style={{marginTop:'8px', marginBottom:'12px', width:'180px', minWidth:'50%' }}/>
                    <Menu.Item key="1">key1</Menu.Item>
                    <Menu.Item key="2">key2</Menu.Item>
                    <Menu.Item key="3">key3</Menu.Item>
                </Menu.ItemGroup>
            </Menu>
        );
    }
}

export default Lsider;
